private List<DocField> getDocFields( Class clazz )
{
  List<DocField> fields = infocache.get(clazz);
  if (fields == null) {
    synchronized(infocache) {
      infocache.put(clazz, fields = collectInfo(clazz));
    }
  }
  return fields;
}

